    public static class Struct0 extends DynamicStruct {
        public String accountAddr;

        public BigInteger points;

        public String accountName;

        public List<String> accountTag;

        public byte[] label;

        public Struct0(
                Address accountAddr,
                Int256 points,
                Utf8String accountName,
                DynamicArray<Utf8String> accountTag,
                Bytes32 label) {
            super(accountAddr, points, accountName, accountTag, label);
            this.accountAddr = accountAddr.getValue();
            this.points = points.getValue();
            this.accountName = accountName.getValue();
            this.accountTag = accountTag.getNativeValue();
            this.label = label.getValue();
        }

        public Struct0(
                String accountAddr,
                BigInteger points,
                String accountName,
                List<String> accountTag,
                byte[] label) {
            super(
                    new Address(accountAddr),
                    new Int256(points),
                    new Utf8String(accountName),
                    new DynamicArray<Utf8String>(
                            accountTag
                                    .stream()
                                    .map(obj -> new Utf8String(obj))
                                    .collect(java.util.stream.Collectors.toList())),
                    new Bytes32(label));
            this.accountAddr = accountAddr;
            this.points = points;
            this.accountName = accountName;
            this.accountTag = accountTag;
            this.label = label;
        }
    }

